(45, 1, '2018-08-28 10:04:23', '2018-08-28 10:04:23', 'The Eysenck Personality Inventory (EPI) measures two pervasive,  independent dimensions of personality,  Extraversion-Introversion and Neuroticism-Stability,  which account for most of the variance in the personality domain. Each form contains 57 \"Yes-No\" items with no repetition of items. The inclusion of a falsification scale provides for the detection of response distortion. The traits measured are Extraversion-Introversion and Neuroticism.<!--more--> When you fill out Eysenck’s Personality Inventory (EPI) you get three scores.\r\n<ul>\r\n	<li>The ‘lie score’ is out of 9. It measures how socially desirable you are trying to be in your answers.Those who score 5 or more on this scale are probably trying to make themselves look good and are not being totally honest in their responses.</li>\r\n	<li>The ‘E score’ is out of 24 and measures how much of an extrovert you are.</li>\r\n	<li>The ‘N score’ is out of 24 and measures how neurotic you are.</li>\r\n</ul>\r\nTo interpret the scores,  your E score and your N score are plotted on a graph from which you can read your personality characteristics. The nearer the outside of the circle you are,  the more marked are the personality traits. Please note that the EPI is a very simplistic type of personality measurement scale,  so if you have come out as a personality that does not match what you thought before you took the test,  you are probably right and the test is probably wrong!\r\n\r\n<img src=\"http://formate.plataformate.com/wp-content/plugins/wp-testing/img/EPI-scales.png\" alt=\"EPI scales\" />\r\n<h2>Instructions</h2>\r\nHere are some questions regarding the way you behave,  feel and act. Each question has radio buttons to answer YES or NO. Try to decide whether YES or NO represents your usual way of acting or feeling. Then check those radio named YES or NO. Work quickly,  and don’t spend too much time over any question,  we want your first reaction,  not a long drawn-out thought process. The whole questionnaire shouldn’t take more than a few minutes. Be sure not to omit any questions. Start now,  work quickly and remember to answer every question. There are no right or wrong answers,  and this isn’t a test of intelligence or ability,  but simply a measure of the way you behave.\r\n\r\n<p style=\"color: gray; font-size: 70%; text-align: right;\">This test is a demonstration of <a href=\"http://apsiholog.ru/psychological-tests/\">psychological tests</a> plugin.</p>', 'Eysenck’s Personality Inventory (EPI) (Extroversion/Introversion)', '', 'publish', 'closed', 'closed', '', 'eysencks-personality-inventory-epi-extroversionintroversion', '', '', '2018-08-28 21:21:09', '2018-08-28 21:21:09', '', 0, 'http://a5ccb9dc-aad3-11e8-9ade-fa163e3a5783', 0, 'wpt_test', '', 0),
